import React from "react";
import "./Header.scss";

const Header = (props) => {
  function logout() {
    sessionStorage.setItem("loggedIn", "false");
    props.goto("/");
  }

  return (
    <>
      <div className="sa-header-w">
        <div className="sa-header-profile-section" onClick={() => logout()}>
          Logout
        </div>
      </div>
    </>
  );
};

export default Header;
